import React from 'react';













const Users = () => {
  const data = [
    {title : 'Shimla' , id : 1},
    {title : 'Almond' , id : 2},
    {title : 'Cabage' , id : 3},
  ];






  return (
    <div>
      {data.map((user) => (
        <div className="user">{user.title}</div>
      ))}
    </div>
  );
};


export default Users;
